export const priceValue = ({
  consumerPrice,
  campaignPriceMarket,
  uiConfigData,
}) => {
  if (uiConfigData?.priceField === "CampaignPriceMarket") {
    return campaignPriceMarket ? campaignPriceMarket : consumerPrice;
  } else if (uiConfigData?.priceField === "StandardPrice") {
    return consumerPrice ? consumerPrice : campaignPriceMarket;
  }
  return campaignPriceMarket || consumerPrice;
};
export const darkMode = (symbol) =>
  symbol === "CHF"
    ? "dark"
    : localStorage.getItem("market-place-saved-theme") === "dark"
      ? true
      : false;

